import React, { Component } from 'react';
import './reset.css';
import './text.css';

class App_2 extends Component {
  render() {
    return (
      <div className="App_2">
        <header className="App-header">


          <p>
            Edit <code>src/App.js</code> and save to reload.
          </p>

        </header>
      </div>
    );
  }
}

export default App_2;
